window.bookSummaryJSON = "<p>Run an entire school for magic. No pressure, right?</p> <p>Wrong.</p> <p>It’s all pressure. Nothing but pressure.</p> <p>The rest of my Coven got to go home and relax. All I want to do after the last few months is sit on my couch, eat a whole box of cookies, and binge watch mindless feel-good movies. But apparently that is not on my to-do list.</p> <p>To top it all off…it’s Christmas season. In Manhattan. And I get to host the Yule Ball for all of Eden. Every witch and shifter in the world has been invited...to show off our new School of Magical Arts. Now I just have to make sure we're ready for the world.</p> <p>But right...no pressure. NBD.</p>"; 
